import React from "react"

const Indexmenu = ({ link, alt, heading }) => {
  return (
    <div
      className="indexmenu"
      alt={alt}
      style={{
        backgroundImage:
          "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSO2JpOjjlfQ8jiR9rNo8NHmgisBkHSUHwkpJ3ycr5-GUmvuFSRi",
        maxWidth: "100%",
        maxHeight: "100%"
      }}
    >
      <img src={link} />
      <h2>{heading}</h2>
    </div>
  )
}
export default Indexmenu
